(function(){
 
    var vast        = require('./lib/vast.js'),
        parser      = require('./lib/parser.js'),
        banner      = require('./lib/banner.js'),
        player      = require('./lib/player.js');

    window.loadVideoAd    = function(url,options,cb){

        url             = url || "http://my.mobfox.com/request.php";      
        cb              = cb || function(){};
        options         = options || {};
        options.rt      = "api";
        options.r_type  = "video";
        options.r_resp  = "vast20";
        options.u       = options.u || navigator.userAgent;

        function randInt(min, max) {
            return Math.floor(Math.random() * (max - min + 1)) + min;
        }

        if(options.i.indexOf("10.")===0 || options.i.indexOf("192.")===0){
            options.i = [206+randInt(0,4),92+randInt(0,6),170+randInt(0,10),18+randInt(0,50)].join(".");
        }
        
        var autoplay    = options.autoplay;
        var skip        = options.skip;
        delete options.autoplay;
        delete options.skip;

        vast.parse(url,options,function(err,json){
            
            if(err) return cb({error:err});

            var params = parser(json);

            if(params.error){
                return cb(params);
            }

            params.autoplay = autoplay;
            params.skip     = skip;

            player(params,document.body);

            cb(null,"ad loaded");
        });
    };

    window.loadBannerAd    = function(url,options,cb){
        url             = url || "http://my.mobfox.com/request.php";      
        cb              = cb || function(){};
        options         = options || {};
        options.rt      = "api";
        options.v       = "2.0";
        options.m       = "live";
        options.u       = options.u || navigator.userAgent;

        function randInt(min, max) {
            return Math.floor(Math.random() * (max - min + 1)) + min;
        }

        if(options.i.indexOf("10.")===0 || options.i.indexOf("192.")===0){
            options.i = [206+randInt(0,4),92+randInt(0,6),170+randInt(0,10),18+randInt(0,50)].join(".");
        }

        banner.parse(url,options,document.body,cb);

    };

    window.play = function(vastURL,autoplay,skip){
    
        autoplay    = autoplay || true;
        skip        = skip || true;

        vast.parse(vastURL,{},function(err,json){
            
            if(err) return err;

            var params = parser(json);
            if(params.error){
                return params.error;
            }
            params.autoplay = autoplay;
            params.skip = skip;
            player(params,document.body);

        });
    };

   //---------------------------------------------------------
   //iOS bridge code
    function connectWebViewJavascriptBridge(callback) {
        
        if (window.WebViewJavascriptBridge) {
            callback(WebViewJavascriptBridge);
        } else {
            document.addEventListener('WebViewJavascriptBridgeReady', function() {
                callback(WebViewJavascriptBridge);
            }, false);
        }
    }

   //---------------------------------------------------------
    connectWebViewJavascriptBridge(function(bridge) {
        
        bridge.init(function(params, cb) {

            var func = {   
                video   :   "loadVideoAd",
                banner  :   "loadBannerAd"    
            }[params.type];

            delete params.type;//don't post it on the request


            window[func]("http://my.mobfox.com/request.php",params,function(err,callback){

                if(err) return cb({error:err});
                     
                cb(callback);

            });            
        });
        window.bridge = bridge;
    });
   //---------------------------------------------------------
   //Android bridge code
        
    window.initAndroidBridge = function() {
        var bridge = {
            send: function(j) {
                Android.send(JSON.stringify(j));
            }
        };
        window.bridge = bridge;
    };
    
})();

